        { id: 1, name: "Rise of Champions",Date:"12/02/2022",price: 38.02,eventImg:"https://img.evbuc.com/https%3A%2F%2Fcdn.evbuc.com%2Fimages%2F144220057%2F567194726741%2F1%2Foriginal.20210811-110608?w=512&auto=format%2Ccompress&q=75&sharp=10&rect=13%2C500%2C1598%2C799&s=4b5a93b459e5f9d3749b22cacf02b1e8"},
