    ];
    return(
        <div>
            <ListGroup>
                {events.map((item,index ) => {
                    return(
                        <ListGroup.Item className={SportsStyle.listItem} action href="#link1">
                            <Col xs={6} md={4} ><img className={SportsStyle.eventImg} src={item.eventImg}  alt={'Image failed to load'}/></Col>
                            <Col  xs={12} md={8}><div className={SportsStyle.eventInfo}>test</div></Col>
                        </ListGroup.Item>
                    )

                })}
                {/*<ListGroup.Item action href="#link1">*/}
                {/*    Link 1*/}
                {/*</ListGroup.Item>*/}
